import React from "react";

import Typed from "react-typed";

const Hero = () => {
  return (
    <div className="text-white max-w-[800] mt-[-96px] h-screen mx-auto text-center flex flex-col justify-center">
      <p className="text-[#00df9a] font-bold p2">Welcome to Mart</p>
      <h1 className="d:text-7xl sm:text-6xl text-4xl font-bold md:py-6">
        Online Store
      </h1>
      <div className="flex justify-center items-center">
        <p
          className="md:text-5xl sm:text-4xl
         text-6xl font-bold "
        >
          Cheap
        </p>
        <Typed
          className="md:text-5xl sm:text-4xl
         text-6xl font-bold pl-2"
          strings={["T-Shirts,Pants,Jeans,Tops"]}
          typeSpeed={120}
          backSpeed={140}
          loop
        />
      </div>
    </div>
  );
};
export default Hero;
